class UserGreeting extends Component {

    constructor(props) {
        super(props)

        this.state = {
             isLoggedin:false
        }
    }

    render() {
        if (this.state.isLoggedin){
            return(
                <div>Welcome Bre</div>
            )
        } else {
            return(
                <div>Welcome Random Person</div>

            )
        }
        return (
            <div>
                <div>Welcome Bre</div>
                <div>Welcome random person</div>
            </div>
        )
    }
}

export default UserGreeting
